["2020-01-17","Il était une fois... West Shefford!","il-etait-une-fois-west-shefford","c8f87c98-9c80-45b4-bbde-9a2b47405857","SAS & cie","8719d207-1ec9-4e7c-bfb9-19c79f7c3bdf","45.318333","-72.650833","N45 19.100 W072 39.050","5","Linéaire","https://labs.geocaching.com/goto/WestShefford","Venez découvrir l&#39;histoire de l&#39;arrivée des premiers colons à West Shefford par une visite dans &#34;Le Vieux Bromont&#34;. La visite des 5 emplacements demandera entre 30 et 45 minutes à pied. Les réponses aux questions sont toutes numériques et le format à utiliser vous sera fourni entre parenthèses à la fin de chaque question pour éviter toute confusion. Ne pas inclure les parenthèses aux réponses.<br />Une cache bonus (GC8HPQM) est liée à cette Adventure Lab,<br />Bon voyage dans le temps!<br /><br />Come and discover the story of the arrival of the first settlers in West Shefford while visiting &#34;Le Vieux Bromont&#34;. The visit of the 5 locations will require between 30 and 45 minutes on foot. The answers to the questions are all numerical and the format to be used will be provided in brackets at the end of each question to avoid any confusion. Do not include brackets in the answers.<br />A bonus cache (GC8HPQM) is linked to this Adventure Lab.<br />Now, go back in time and have fun!<br /><br />Parking:  N 45° 19.100 W 72° 39.050","https://gsmediadata.blob.core.windows.net/mediacontainer/641d2530-2857-49f7-9fdb-4bbb9f102d36","GC8HPQM","Bonus- Adventure Lab West Shefford",""],
["2020-01-02","Granby, des vestiges industriels sur la Yamaska","granby-des-vestiges-industriels-sur-la-yamaska","5883ce19-69b2-4c45-9d60-2d9e2a01e10c","colibrios","42dd4aac-ecbf-4e0a-8d7d-45d33ea74dd4","45.396067","-72.731800","N45 23.764 W072 43.908","5","Linéaire","https://labs.geocaching.com/goto/labgranby","Cette Lab Aventure dans la ville de Granby vous fera parcourir les lieux où les premières industries se sont établies le long de la rivière Yamaska. Vous découvrirez 3 générations de la famille Miner, des entrepreneurs qui ont contribué au développement industriel et économique de Granby au tournant des années 1900. <br /> <br />La distance à parcourir à pied est de 3 km pour une durée d&#39;environ 45 min. <br />Bien que cette Lab Aventure peux se faire l&#39;hiver, il se pourrait que certains indices soient plus difficiles à obtenir selon la quantité de neige.<br /><br />Vous pourrez signer une cache Bonus ( GC8HPQW ) à la fin de votre parcours. <br />Bonne randonnée et bonnes découvertes!<br />Parking: N45° 23.764 W072° 43.908<br /><br /><br /><br />","https://gsmediadata.blob.core.windows.net/mediacontainer/e1d32867-9ef9-486d-a8f1-582620ec7778","GC8HPQW","Bonus-LabAventure-Granby, des vestiges industriels",""],
["2019-12-26","Les personnages célèbres de Trois-Rivières","les-personnages-celebres-de-trois-rivieres","dffcb8e4-2b3c-4889-938d-854011df4632","cbasd","50133ba9-d67f-444a-b5e1-c6073d07db0d","46.342750","-72.539500","N46 20.565 W072 32.370","5","Non linéaire","https://labs.geocaching.com/goto/PVTR12","Bienvenue sur cette lab cache qui vous fera connaître quelques personnages important dans l&#39;histoire de la Ville de Trois-Rivières.<br />Les réponses aux questions qui vous seront posées se trouvent sur les monuments ou sur les plaques.<br />Pour cette visite vous allez marcher environ 1,5 km, faire cette lab cache vous prendra moins d&#39;une heure. Vous pouvez faire comme bon vous semble les étapes car il n&#39;y a pas d&#39;ordre à respecter, cette coordonnée de départ est près de plusieurs stalles de stationnements.<br />À noter aussi qu&#39;il y a un Wi-fi gratuit, &#34;Trois-Rivières Wi-Fi!&#34;.<br />Plusieurs waymarks sont sur ce trajet.<br />À chacune des étapes il y aura une lettre et une petite énigme, ceci vous sera utile afin d&#39;obtenir la coordonnée finale de la cache Bonus Lab cache Les personnages célèbres de T-R (GC8HG2Q), la finale se trouve à moins de 5 km du centre ville, allez vous résister longtemps pour aller chercher la finale de cette cache.<br />","https://gsmediadata.blob.core.windows.net/mediacontainer/df8da566-36ea-40ed-b59c-184799904bfd","GC8HG2Q","Bonus Lab cache Les personnages célèbres de T-R",""],
["2019-12-23","Promenade du vieux quai","promenade-du-vieux-quai","0030a4d4-6576-44dd-8bbb-ead2f19b2467","Bédé","e5e91db6-0e7a-48cd-bb88-d3b66354c48a","50.206017","-66.389550","N50 12.361 W066 23.373","5","Non linéaire","https://labs.geocaching.com/goto/BedeLab","Sept-Iles,<br /><br />La promenade du Vieux Quai, est située sur les berges de la baie de Sept-Iles. Elle se compose de trottoirs de bois et de panneaux d&#39;interprétations racontant l&#39;histoire des environs. Nous vous ferons découvrir cinq de ses emplacement tout au long de votre parcours.<br /><br />Bonne découverte.<br />____________________________________________________________________________________________<br />Sept-Iles,<br /><br />The promenade of the Vieux Quai is located on the banks of the Sept-Iles bay. It is made up of wooden sidewalks and interpretive panels telling the history of the surroundings. We will show you five of its locations along your route.<br /><br />Good discovery.","https://gsmediadata.blob.core.windows.net/mediacontainer/d6d0ee27-430b-4e38-9f19-f71893e2c31a"," ","",""],
["2019-11-26","Le Trait-Carré de Charlesbourg","le-trait-carre-de-charlesbourg","99fa359c-3e32-4166-b504-767fbab3ccdd","ChanDani","5c2f4f34-73e5-4b4e-8095-e0cab90a058a","46.860617","-71.270250","N46 51.637 W071 16.215","5","Linéaire","https://labs.geocaching.com/goto/ChanDani","Bienvenue dans le centre historique du Trait-Carré de Charlesbourg. Ce secteur a été déclaré site patrimonial en 1965. Ces 5 lab caches vous feront découvrir le centre ainsi que les quatres coins qui forment le Trait-Carré. Tout au long du parcours, vous trouverez des panneaux expliquants la création du Trait-Carré et plusieurs détails qui le caractérisent. Vous y trouverez parfois des réponses à vos questions. <br />Pour débuter, nous vous invitons à venir au centre de celui-ci. Il vous sera possible de stationner à la bibliothèque municipale qui partage son stationnement avec l&#39;église St-Charles-Borromée.<br /><br />Bon parcours !","https://gsmediadata.blob.core.windows.net/mediacontainer/44705c7a-819a-4490-973b-aed4014c1198"," ","",""],
["2019-11-23","Ponts couverts exceptionnels du Québec","ponts-couverts-exceptionnels-du-quebec","e256f188-606e-4cb2-8a35-bb381986c839","Pokertime!","509657f5-a617-492d-8ea9-e96b797a3b28","46.181633","-70.713167","N46 10.898 W070 42.790","5","Non linéaire","https://labs.geocaching.com/goto/Ponts","Ah! Les ponts couverts!  Qui n&#39;a jamais eu cette fébrilité, cet enthousiasme, cette fascination à la vue d&#39;un pont couvert qu&#39;on s&#39;apprête à traverser en voiture?<br />Je fais partie de ceux qui ont une admiration sans borne pour ce type de construction d&#39;une autre époque.  Car oui, il est vrai de dire que ces architectures et ces édifications font désormais partie de l&#39;histoire.<br /><br />Dans cette AdventureLab, j&#39;espère vous transmettre une petite partie de mon savoir et de ma passion pour ces ouvrages anciens.  Elle est conçue en 5 étapes non-linéaires qui vous feront visiter 5 ponts couverts Québécois que j&#39;ai estimé incontournables.  Il est donc possible de visiter les ponts couverts dans l&#39;ordre de votre choix et au rythme qu&#39;il vous conviendra.  À chacune des étapes accomplies, des parties de coordonnées vous seront affichées pour trouver l&#39;emplacement final de cette cache mystère: GC8GNDC (Indice: Lévis)<br /><br />Amusez-vous bien!<br /><br />Pokertime!","https://gsmediadata.blob.core.windows.net/mediacontainer/dad6f321-2643-4121-a9fd-3393a3d333c0","GC8GNDC","AdventureLab &#34;Ponts Couverts &#91;…&#93;&#34; par Pokertime!",""],
["2019-11-21","Vieux Charlesbourg","vieux-charlesbourg","3960a994-bc3e-4cbb-961b-5ea3e885d28e","MystRanger","53f79807-c4c7-405d-b186-9dcdd21cea28","46.862433","-71.267117","N46 51.746 W071 16.027","5","Linéaire","https://labs.geocaching.com/goto/vieux-charlesbourg","(English follows)<br />Bienvenue dans cette courte visite interactive du Vieux Chalresbourg et plus spécifiquement, le Trait-Carré et ses environs.<br />Elle se veut une introduction au passé de cette ville qui m&#39;est chère et où j&#39;ai grandi.<br />J&#39;espère qu&#39;elle vous amènera à en vouloir connaître plus sur cette configuration de ville unique au monde et à son passé riche en histoire !<br /><br />Prenez le temps de CLIQUER SUR LES IMAGES et de voir vos NOTES DE JOURNAL à chaque bonne réponse pour plus de photos historiques!<br /><br />Bonne visite!<br />-----------<br />Welcome to this short interactive visit of the Old Charlesbourg and more precisely, the Trait-Carré and all around it.<br />This will be an introduction to the city&#39;s past, this city that has a special place in my heart since I grew up here.<br />I hope that this will give you the need to know more about this special and unique city configuration and its history-enriched past !<br /><br />Take time to review your JOURNAL ENTRIES for more historical photos and details!<br /><br />Have a wonderful visit!","https://gsmediadata.blob.core.windows.net/mediacontainer/77e0b09c-183f-4bdb-89f2-4ffc8ad00cc4"," ","",""],
["2019-11-15","Aventure au Stade Olympique (Bilingual)","aventure-au-stade-olympique-bilingual","865b5eca-6ccc-474f-839e-fc02e66fbeff","LeGuerrier","1b392776-cc77-448f-807a-a46d4c2d3b43","45.559383","-73.551250","N45 33.563 W073 33.075","5","Non linéaire","https://labs.geocaching.com/goto/Olympique","Le Stade Olympique de Montréal est le stade polyvalent de Montréal qui a été construit pour accueillir les Jeux olympiques d&#39;été de 1976. Le stade olympique est la pièce maîtresse du Parc olympique de Montréal. Surnommé le Big O, le stade olympique est doté d&#39;un toit escamotable.<br /><br />Le stade olympique est l&#39;une des attractions les plus populaires. Un monument unique au monde, devenu l&#39;icône de Montréal à l&#39;international. Venez découvrir avec 5 localisations de LabAdventure.<br />_____________<br /><br />The Montreal Olympic Stadium (Stade Olympique de Montréal) is Montreal&#39;s multi-purpose stadium that was built as the main venue for the 1976 Summer Olympics. The Olympic Stadium is the centerpiece of the Montreal Olympic Park (Parc Olympique Montréal). Nicknamed The Big O, the Olympic Stadium features a retractable roof.<br /><br />A monument unique in the world, which has become Montreal&#39;s international icon. Come discover with 5 LabAdventure locations.","https://gsmediadata.blob.core.windows.net/mediacontainer/f1b8d6df-0549-4b88-9bee-734a870a5768"," ","",""],
["2019-11-10","Parc de la rivière Beauport","parc-de-la-riviere-beauport","595f0985-4236-4b2a-a43e-865b4c2e8d64","BOD21","c79e8233-a47a-470a-9074-2281f4fe54c9","46.864867","-71.207967","N46 51.892 W071 12.478","5","Non linéaire","https://labs.geocaching.com/goto/RivièreBeauport","Un petit parcours d&#39;environ 1,5 km sur ce sentier bien aménagé avec quelques beaux points de vue sur la rivière.<br />Vous aurez accès au contenant final après avoir parcouru les 5 étapes et récolté quelques nombres qui après quelques manipulations vous donneront les coordonnées.<br /><br />La cache se trouve aux coordonnées suivantes : N 46° 51.XXX&#39; W 71° 12.YYY&#39;<br /><br />Où XXX = B - (AxE)-(HxE)- F - D - (C/3)<br /><br />YYY = (GxI) + (LxG) + (Kx3) + (D-J)<br /><br />Validation : X + X + X + Y + Y + Y = 18","https://gsmediadata.blob.core.windows.net/mediacontainer/0386db58-a83b-4732-8318-81073bd733ad","GC8FX2B","Parc de la rivière Beauport-Adventure Lab",""],
["2019-10-14","Les Héros de la Place d&#39;Armes (Bilingual)","les-heros-de-la-place-d-armes-bilingual","0f2edf1e-20f1-483c-9b35-1bb2a543f959","W1zz","f28b5129-d294-47f2-ba61-1ed0898c36d0","45.504833","-73.557250","N45 30.290 W073 33.435","5","Non linéaire","https://labs.geocaching.com/goto/non","Vous êtes sur la Place d&#39;Armes, 2e plus ancienne place publique de Montréal. En 1895, un monument en hommage à Maisonneuve, fondateur de Montréal, ainsi que de 4 autres figures historiques y est aménagé. Écoutez ce que ces 5 héros de l&#39;histoire de Montréal vous racontent ! Trouvez les réponses à leurs questions dans le quadrilatère formé des bâtiments entourant la Place d&#39;Armes.<br />- - - - - - - - - - - - - - - - - - - - <br />Your are on the Place d&#39;Armes, second oldest public place in Montreal. In 1895, a monument honoring Maisonneuve, founder of Montreal and 4 other historical figures was erected. Listen to what these 5 heros from Montreal&#39;s history have to tell you. Find the answers to their questions in the quandrangle formed by the buildings surrounding the Place d&#39;Armes.<br /><br />Recommandé le jour / Easier with daylight.<br /><br />Sincères remerciements / Heartfelt thanks to:<br />PatrickValerie & Pryncesse<br />pour leur assistance / for their help.","https://gsmediadata.blob.core.windows.net/mediacontainer/e7b1636b-7cd2-47c5-99f1-ad996a7c84e9"," ","",""],
["2019-08-24","Vieux Québec","vieux-quebec","634fad72-13b0-4c8b-b085-61f8ec0b72e6","bretonv","798c550b-7509-4a70-90d9-c944700455c5","46.811167","-71.213800","N46 48.670 W071 12.828","10","Linéaire","https://labs.geocaching.com/goto/VieuxQuebec","Une aventure destinée à vous faire découvrir des endroits marquants du vieux Quebec.  Vous devez avoir un forfait cellulaire avec données pour réaliser l&#39;aventure qui comporte plusieurs vidéo à visionner.<br />L&#39;aventure débute par le stationnement Honoré-Mercier question d&#39;ajouter un côté pratique au début de la balade en vous permettant de stationner votre véhicule, le trajet pouvant se faire agréablement à pied.  Tout au long du trajet, vous aurez l&#39;occasion de vous informer sur l&#39;histoire des lieux que vous découvrirez.<br /><br />Pour chaque étape, un vidéo présente un endroit et se termine sur un élément spécifique que vous devez identifier pour répondre à la question confirmant que vous avez visité l&#39;endroit.  Un &#34;Find&#34; est attribuée par emplacement terminé. Cette aventure procure &#34;10 Lab-caches find&#34;. Les lab-caches sont incluses dans certaines statistiques.  Au 10e emplacement, vous recevrez les coordonnées de la cache mystère associée à cette aventure.","https://gsmediadata.blob.core.windows.net/mediacontainer/c1a2f0f9-7d81-41f7-8d30-a96478bc3c34","GC8D539","Aventure Vieux-Québec Bonus Lab cache",""],
["2019-08-09","Promenade historique dans le vieux St-Eustache","promenade-historique-dans-le-vieux-st-eustache","97e5b86f-978e-4b84-8b93-643a324f7441","unoyt","f684fe55-3d76-4070-a2ad-2a3845c55a6b","45.558317","-73.897200","N45 33.499 W073 53.832","5","Non linéaire","https://labs.geocaching.com/goto/1234","Que ce soit pour découvrir l&#39;histoire de la ville à travers ses sites patrimoniaux ou encore pour participer à des activités culturelles, chacun pourra vivre une expérience enrichissante car le Vieux-Saint-Eustache regorge d&#39;attraits. Profitez des circuits touristiques pour en connaître davantage sur différents bâtiments témoins de l&#39;histoire de Saint-Eustache: le moulin Légaré, le manoir Globensky, l&#39;église de Saint-Eustache et de nombreux autres bâtiments!<br /><br />L&#39;aventure vous fera découvrir cinq lieux historiques du vieux St-Eustache et la distance totale du parcours pédestre est d&#39;environ deux kilomètres. Prendre note que la ville de St-Eustache est une ville branchée et qu&#39;il y a du Wi-Fi gratuit à certains endroits sur votre parcours.<br /><br />Bonne randonnée et bonne aventure!","https://gsmediadata.blob.core.windows.net/mediacontainer/ee32bd9e-d271-4b83-a762-ca0be7ae25ca","GC8CMNK","Promenade historique - BONUS - (ü1111)",""]
